import React from "react";

const ListGroup=(props)=>{
    const movie_genres = props.movie_genres;
    return(
        <div className="list-group">
            {this.movie_genres.map((movie_genres)=>(
                <a href="" className="list-group-item">movie_genres</a>
            )
            )}
        
        </div>
    );
}

export default ListGroup;
